import React from 'react';
import { Navbar, Container } from 'react-bootstrap';

const NavbarPublic = () => {
  return (
    <Navbar bg="dark" variant="dark">
      <Container>
        <Navbar.Brand>Transporte Bolivia</Navbar.Brand>
      </Container>
    </Navbar>
  );
};

export default NavbarPublic;
